import React from 'react';
import "./Home.css";

const Home = () => {
  return (
    <div className="Home">
      <h1>Bienvenidos a la web del arte</h1>
      <p>Para poder acceder a los contenidos tenéis que logaros en la página accediendo a través del menú superior en "Login". </p>
      <p>Si todavía no tenéis un usuario, también podéis registraros clicando en <strong>"Registro"</strong>.</p>
    </div>
  )
}

export default Home;
